import './../../constants/Dimensions';
import { SharedCard } from './SharedCard';
import { TrioFingerPush } from './../Animation/TrioFingerPush';

export const CardDeviceSetup = () => {
  const image = <TrioFingerPush/>;
  const description = 'Please complete your device setup';
  const navLink = 'List';
  const nextButton = true;

  return (
    <>
      <SharedCard image={image}  description={description} navLink={navLink} nextButton={nextButton}nextButton={nextButton} />
    </>
  );
};
